public static String getRmPrincipal(Configuration conf) throws IOException {
  String principal = conf.get(YarnConfiguration.RM_PRINCIPAL);
  String prepared = null;

  if (principal != null) {
    prepared = getRmPrincipal(principal, conf);
  }

  return prepared;
}
